import { Route, BrowserRouter as Router, Routes } from "react-router-dom";
import ResumeUpload from "./components/ResumeUpload";

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/resume" element={<ResumeUpload />} />
            </Routes>
        </Router>
    );
}

export default App;
